import React from 'react';

const Footer = () => {
  return (
    <footer style={{ textAlign: 'center', padding: '1rem', backgroundColor: '#006699', color: '#fff' }}>
      <p>&copy; 2024 Pool Company. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
